-- Create test questions table
CREATE TABLE public.test_questions (
    source_blquestion_id integer NOT NULL,
    question_index integer NOT NULL,
    correct_answer_value character varying(5) NOT NULL,
    correct_answer_text text NOT NULL,
    topic_id uuid NOT NULL,
    test character varying NOT NULL,
    course character varying NOT NULL,
    module character varying NOT NULL
);

-- Populate the table


-- Add constraints
-- ===============
-- Primary key on blquestion_id
ALTER TABLE ONLY public.test_questions
    ADD CONSTRAINT test_questions_pkey PRIMARY KEY (source_blquestion_id);

-- Compound foreign key on test, course, modeule
ALTER TABLE ONLY public.test_questions
    ADD CONSTRAINT questions_tmarks_fkey FOREIGN KEY (test, course, module) REFERENCES public.test_marks(test_id, course, module) ON UPDATE CASCADE;

-- Foreign key on topic_id
ALTER TABLE ONLY public.test_questions
    ADD CONSTRAINT questions_topic_id_fkey FOREIGN KEY (topic_id) REFERENCES public.test_topics(topic_id) ON UPDATE CASCADE;
